('en','messages:apihelp-main-param-format','s:25:\"The format of the output.\";'),
('en','messages:apihelp-main-param-maxage','s:101:\"Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),
('en','messages:apihelp-main-param-maxlag','s:488:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),
('en','messages:apihelp-main-param-origin','s:1005:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is allowed, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),
('en','messages:apihelp-main-param-requestid','s:91:\"Any value given here will be included in the response. May be used to distinguish requests.\";'),
('en','messages:apihelp-main-param-responselanginfo','s:89:\"Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),
('en','messages:apihelp-main-param-servedby','s:60:\"Include the hostname that served the request in the results.\";'),
('en','messages:apihelp-main-param-smaxage','s:102:\"Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),
('en','messages:apihelp-main-param-uselang','s:322:\"Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),
('en','messages:apihelp-main-param-variant','s:85:\"Variant of the language. Only works if the base language supports variant conversion.\";'),
('en','messages:apihelp-main-paramvalue-errorformat-bc','s:100:\"Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),
('en','messages:apihelp-main-paramvalue-errorformat-html','s:4:\"HTML\";'),
('en','messages:apihelp-main-paramvalue-errorformat-none','s:37:\"No text output, only the error codes.\";'),
('en','messages:apihelp-main-paramvalue-errorformat-plaintext','s:54:\"Wikitext with HTML tags removed and entities replaced.\";'),
('en','messages:apihelp-main-paramvalue-errorformat-raw','s:27:\"Message key and parameters.\";'),
('en','messages:apihelp-main-paramvalue-errorformat-wikitext','s:18:\"Unparsed wikitext.\";'),
('en','messages:apihelp-main-summary','s:0:\"\";'),
('en','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),
('en','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),
('en','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),
('en','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),
('en','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),
('en','messages:apihelp-managetags-param-operation','s:27:\"Which operation to perform:\";'),
('en','messages:apihelp-managetags-param-reason','s:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),
('en','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),
('en','messages:apihelp-managetags-param-tags','s:60:\"Change tags to apply to the entry in the tag management log.\";'),
('en','messages:apihelp-managetags-paramvalue-operation-activate','s:59:\"Activate a change tag, allowing users to apply it manually.\";'),
('en','messages:apihelp-managetags-paramvalue-operation-create','s:39:\"Create a new change tag for manual use.\";'),
('en','messages:apihelp-managetags-paramvalue-operation-deactivate','s:68:\"Deactivate a change tag, preventing users from applying it manually.\";'),
('en','messages:apihelp-managetags-paramvalue-operation-delete','s:144:\"Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\";'),
('en','messages:apihelp-managetags-summary','s:49:\"Perform management tasks relating to change tags.\";'),
('en','messages:apihelp-mergehistory-example-merge','s:71:\"Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),
('en','messages:apihelp-mergehistory-example-merge-timestamp','s:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),
('en','messages:apihelp-mergehistory-param-from','s:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),
('en','messages:apihelp-mergehistory-param-fromid','s:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),
('en','messages:apihelp-mergehistory-param-reason','s:29:\"Reason for the history merge.\";'),
('en','messages:apihelp-mergehistory-param-timestamp','s:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),
('en','messages:apihelp-mergehistory-param-to','s:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),
('en','messages:apihelp-mergehistory-param-toid','s:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),
('en','messages:apihelp-mergehistory-summary','s:21:\"Merge page histories.\";'),
('en','messages:apihelp-move-example-move','s:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),
('en','messages:apihelp-move-param-from','s:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),
('en','messages:apihelp-move-param-fromid','s:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),
('en','messages:apihelp-move-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),
('en','messages:apihelp-move-param-movesubpages','s:31:\"Rename subpages, if applicable.\";'),
('en','messages:apihelp-move-param-movetalk','s:35:\"Rename the talk page, if it exists.\";'),
('en','messages:apihelp-move-param-noredirect','s:24:\"Don\'t create a redirect.\";'),
('en','messages:apihelp-move-param-reason','s:22:\"Reason for the rename.\";'),
('en','messages:apihelp-move-param-tags','s:99:\"Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),
('en','messages:apihelp-move-param-to','s:28:\"Title to rename the page to.\";'),
('en','messages:apihelp-move-param-unwatch','s:67:\"Remove the page and the redirect from the current user\'s watchlist.\";'),
('en','messages:apihelp-move-param-watch','s:62:\"Add the page and the redirect to the current user\'s watchlist.\";'),
('en','messages:apihelp-move-param-watchlist','s:137:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),
('en','messages:apihelp-move-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),
('en','messages:apihelp-move-summary','s:12:\"Move a page.\";'),
('en','messages:apihelp-no-such-module','s:22:\"Module \"$1\" not found.\";'),
('en','messages:apihelp-none-summary','s:15:\"Output nothing.\";'),
('en','messages:apihelp-opensearch-example-te','s:40:\"Find pages beginning with <kbd>Te</kbd>.\";'),
('en','messages:apihelp-opensearch-param-format','s:25:\"The format of the output.\";'),
('en','messages:apihelp-opensearch-param-limit','s:36:\"Maximum number of results to return.\";'),
('en','messages:apihelp-opensearch-param-namespace','s:90:\"Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),
('en','messages:apihelp-opensearch-param-redirects','s:24:\"How to handle redirects:\";'),
('en','messages:apihelp-opensearch-param-redirects-append','s:98:\"For historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),
('en','messages:apihelp-opensearch-param-search','s:14:\"Search string.\";'),
('en','messages:apihelp-opensearch-param-suggest','s:15:\"No longer used.\";'),
('en','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),
('en','messages:apihelp-opensearch-paramvalue-redirects-resolve','s:62:\"Return the target page. May return fewer than $1limit results.\";'),
('en','messages:apihelp-opensearch-paramvalue-redirects-return','s:27:\"Return the redirect itself.\";'),
('en','messages:apihelp-opensearch-summary','s:46:\"Search the wiki using the OpenSearch protocol.\";'),
('en','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),
('en','messages:apihelp-options-example-complex','s:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),
('en','messages:apihelp-options-example-reset','s:22:\"Reset all preferences.\";'),
('en','messages:apihelp-options-extended-description','s:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),
('en','messages:apihelp-options-param-change','s:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),
('en','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),
('en','messages:apihelp-options-param-optionvalue','s:62:\"The value for the option specified by <var>$1optionname</var>.\";'),
('en','messages:apihelp-options-param-reset','s:40:\"Resets preferences to the site defaults.\";'),
('en','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),
('en','messages:apihelp-options-summary','s:39:\"Change preferences of the current user.\";'),
('en','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),
('en','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),
('en','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),
('en','messages:apihelp-paraminfo-param-helpformat','s:23:\"Format of help strings.\";'),
('en','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),
('en','messages:apihelp-paraminfo-param-modules','s:241:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),
('en','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),
('en','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),
('en','messages:apihelp-paraminfo-summary','s:37:\"Obtain information about API modules.\";'),
('en','messages:apihelp-parse-example-page','s:13:\"Parse a page.\";'),
('en','messages:apihelp-parse-example-summary','s:16:\"Parse a summary.\";'),
('en','messages:apihelp-parse-example-text','s:15:\"Parse wikitext.\";'),
('en','messages:apihelp-parse-example-texttitle','s:42:\"Parse wikitext, specifying the page title.\";'),
('en','messages:apihelp-parse-extended-description','s:500:\"See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),
('en','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),
('en','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),
('en','messages:apihelp-parse-param-disableeditsection','s:47:\"Omit edit section links from the parser output.\";'),
('en','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),
('en','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),
('en','messages:apihelp-parse-param-disablestylededuplication','s:59:\"Do not deduplicate inline stylesheets in the parser output.\";'),
('en','messages:apihelp-parse-param-disabletoc','s:33:\"Omit table of contents in output.\";'),
('en','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),
('en','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),
('en','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),
('en','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),
('en','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),
('en','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),
('en','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),
('en','messages:apihelp-parse-param-prop','s:35:\"Which pieces of information to get:\";'),
('en','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),
('en','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),
('en','messages:apihelp-parse-param-revid','s:84:\"Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),
('en','messages:apihelp-parse-param-section','s:240:\"Only parse the content of the section with this identifier.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),
('en','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),
('en','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),
('en','messages:apihelp-parse-param-showstrategykeys','s:71:\"Whether to include internal merge strategy information in jsconfigvars.\";'),
('en','messages:apihelp-parse-param-summary','s:17:\"Summary to parse.\";'),
('en','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),
('en','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),
('en','messages:apihelp-parse-param-useskin','s:211:\"Apply the selected skin to the parser output. May affect the following properties: <kbd>text</kbd>, <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),
('en','messages:apihelp-parse-param-wrapoutputclass','s:43:\"CSS class to use to wrap the parser output.\";'),
('en','messages:apihelp-parse-paramvalue-prop-categories','s:44:\"Gives the categories in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:41:\"Gives the HTML version of the categories.\";'),
('en','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),
('en','messages:apihelp-parse-paramvalue-prop-externallinks','s:48:\"Gives the external links in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-headhtml','s:141:\"Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),
('en','messages:apihelp-parse-paramvalue-prop-headitems','s:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),
('en','messages:apihelp-parse-paramvalue-prop-images','s:40:\"Gives the images in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),
('en','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),
('en','messages:apihelp-parse-paramvalue-prop-langlinks','s:48:\"Gives the language links in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),
('en','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),
('en','messages:apihelp-parse-paramvalue-prop-links','s:48:\"Gives the internal links in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-modules','s:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),
('en','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),
('en','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:69:\"Gives the warnings that occurred while parsing content (as wikitext).\";'),
('en','messages:apihelp-parse-paramvalue-prop-parsewarningshtml','s:65:\"Gives the warnings that occurred while parsing content (as HTML).\";'),
('en','messages:apihelp-parse-paramvalue-prop-properties','s:56:\"Gives various properties defined in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-revid','s:40:\"Adds the revision ID of the parsed page.\";'),
('en','messages:apihelp-parse-paramvalue-prop-sections','s:42:\"Gives the sections in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-subtitle','s:43:\"Adds the page subtitle for the parsed page.\";'),
('en','messages:apihelp-parse-paramvalue-prop-templates','s:43:\"Gives the templates in the parsed wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-text','s:38:\"Gives the parsed text of the wikitext.\";'),
('en','messages:apihelp-parse-paramvalue-prop-wikitext','s:44:\"Gives the original wikitext that was parsed.\";'),
('en','messages:apihelp-parse-summary','s:41:\"Parses content and returns parser output.\";'),
('en','messages:apihelp-patrol-example-rcid','s:23:\"Patrol a recent change.\";'),
('en','messages:apihelp-patrol-example-revid','s:18:\"Patrol a revision.\";'),
('en','messages:apihelp-patrol-param-rcid','s:27:\"Recentchanges ID to patrol.\";'),
('en','messages:apihelp-patrol-param-revid','s:22:\"Revision ID to patrol.\";'),
('en','messages:apihelp-patrol-param-tags','s:52:\"Change tags to apply to the entry in the patrol log.\";'),
('en','messages:apihelp-patrol-summary','s:26:\"Patrol a page or revision.\";'),
('en','messages:apihelp-php-param-formatversion','s:17:\"Output formatting\";'),
('en','messages:apihelp-php-paramvalue-formatversion-1','s:94:\"Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),
('en','messages:apihelp-php-paramvalue-formatversion-2','s:14:\"Modern format.\";'),
('en','messages:apihelp-php-paramvalue-formatversion-latest','s:75:\"Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),
('en','messages:apihelp-php-summary','s:37:\"Output data in serialized PHP format.\";'),
('en','messages:apihelp-phpfm-summary','s:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),
('en','messages:apihelp-protect-example-protect','s:15:\"Protect a page.\";'),
('en','messages:apihelp-protect-example-unprotect','s:105:\"Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),
('en','messages:apihelp-protect-example-unprotect2','s:44:\"Unprotect a page by setting no restrictions.\";'),
('en','messages:apihelp-protect-param-cascade','s:160:\"Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),
('en','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),
('en','messages:apihelp-protect-param-pageid','s:68:\"ID of the page to (un)protect. Cannot be used together with $1title.\";'),
('en','messages:apihelp-protect-param-protections','s:262:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),
