('fr','messages:api-feed-error-title','s:11:\"Erreur ($1)\";'),
('fr','messages:api-format-prettyprint-header','s:437:\"Voici la représentation HTML du format $1. HTML est utile pour le débogage, mais inapproprié pour être utilisé dans une application.\n\nSpécifiez le paramètre <var>format</var> pour modifier le format de sortie. Pour voir la représentation non HTML du format $1, mettez <kbd>format=$2</kbd>.\n\nVoyez la [[mw:Special:MyLanguage/API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),
('fr','messages:api-format-prettyprint-header-hyperlinked','s:421:\"Voici la représentation HTML du format $1. HTML convient au débogage, mais est inapproprié pour être utilisé dans une application.\n\nSpécifiez le paramètre <var>format</var> pour modifier le format de sortie. Pour voir la représentation non HTML du format $1, mettez [$3 <kbd>format=$2</kbd>].\n\nVoir la [[mw:API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’informations.\";'),
('fr','messages:api-format-prettyprint-header-only-html','s:258:\"Ceci est une représentation HTML à des fins de débogage, et n’est pas approprié pour une utilisation applicative.\n\nVoir la [[mw:Special:MyLanguage/API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),
('fr','messages:api-format-prettyprint-status','s:59:\"Cette réponse serait retournée avec l’état HTTP $1 $2.\";'),
('fr','messages:api-format-title','s:33:\"Résultat de l’API de MediaWiki\";'),
('fr','messages:api-help-authmanager-general-usage','s:1642:\"La procédure générale pour utiliser ce module est la suivante :\n# Récupérer les champs disponibles avec <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$4</kbd>, ainsi qu’un jeton <kbd>$5</kbd> avec <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Présenter les champs à l’utilisateur et faites-les lui soumettre.\n# Effectuez l’envoi à ce module, en fournissant <var>$1returnurl</var> et les champs appropriés.\n# Vérifiez la valeur du champ <samp>status</samp> (état) dans la réponse.\n#* Si vous avez reçu <samp>PASS</samp> (réussite) ou <samp>FAIL</samp> (échec), c’est terminé ; l’opération a soit réussi, soit échoué.\n#* Si vous avez reçu <samp>UI</samp> (interface utilisateur), affichez les nouveaux champs à l’utilisateur et faites-les lui soumettre ; puis effectuez leur envoi à ce module avec <var>$1continue</var> et l’ensemble des champs appropriés et reprenez à l’étape 4.\n#* Si vous avez reçu <samp>REDIRECT</samp> (redirection), dirigez l’utilisateur vers la cible indiquée dans le champ <samp>redirecttarget</samp> et attendez son retour à <var>$1returnurl</var> ; puis effectuez l’envoi à ce module avec <var>$1continue</var> et tous les champs passés à l’URL de retour et reprenez à l’étape 4.\n#* Si vous avez reçu <samp>RESTART</samp> (redémarrer), cela veut dire que l’authentification a fonctionné, mais nous n’avons aucun compte utilisateur lié ; vous pouvez traiter cela comme une valeur <samp>UI</samp> (interface utilisateur) ou <samp>FAIL</samp> (échec).\";'),
('fr','messages:api-help-authmanagerhelper-additional-params','s:375:\"Ce module accepte des paramètres supplémentaires selon les requêtes d’authentification disponibles. Utiliser <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> (ou une réponse précédente de ce module, le cas échéant) pour déterminer les requêtes disponibles et les champs qu’elles utilisent.\";'),
('fr','messages:api-help-authmanagerhelper-continue','s:158:\"Cette requête est une continuation après une précédente réponse <samp>UI</samp> ou <samp>REDIRECT</samp>. Cela ou <var>$1returnurl</var> est obligatoire.\";'),
('fr','messages:api-help-authmanagerhelper-mergerequestfields','s:91:\"Fusionner dans un tableau le champ information de toutes les demandes d’authentification.\";'),
('fr','messages:api-help-authmanagerhelper-messageformat','s:47:\"Format à utiliser pour retourner les messages.\";'),
('fr','messages:api-help-authmanagerhelper-preservestate','s:92:\"Conserver l’état d’une précédente tentative de connexion qui a échoué, si possible.\";'),
('fr','messages:api-help-authmanagerhelper-request','s:205:\"Utiliser cette requête d’authentification, avec l’<samp>id</samp> renvoyé par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd>.\";'),
('fr','messages:api-help-authmanagerhelper-requests','s:264:\"Utiliser uniquement ces requêtes d’authentification, avec l’<samp>id</samp> renvoyé par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> ou depuis une réponse précédente de ce module.\";'),
('fr','messages:api-help-authmanagerhelper-returnurl','s:627:\"Renvoyer l’URL pour les flux d’authentification tiers, qui doit être absolue. Soit celle-ci, soit <var>$1continue</var> est obligatoire.\n\nÀ la réception d’une réponse <samp>REDIRECT</samp> (rédirection), vous ouvrirez typiquement un navigateur ou une vue web vers l’URL spécifiée dans le champ <samp>redirecttarget</samp> pour un flux d’authentification tiers. Une cela se termine, le tiers renverra le navigateur ou l’affichage web vers cette URL. Vous devez extraire toute requête et tous les paramètres POST de l’URL et les passer à ce module de l’API comme une requête avec <var>$1continue</var>.\";'),
('fr','messages:api-help-datatype-boolean','s:224:\"Les paramètres booléens fonctionnent comme des cases à cocher HTML : si le paramètre est spécifié, quelle que soit sa valeur, il est considéré comme vrai. Pour une valeur fausse, omettre complètement le paramètre.\";'),
('fr','messages:api-help-datatype-expiry','s:357:\"Les valeurs d’expiration peuvent être relatives (par ex. <kbd>5 months</kbd> pour 5 mois ou <kbd>2 weeks</kbd> pour 2 semaines) ou absolues (par ex. <kbd>2014-09-18T12:34:56Z</kbd>). Pour ne pas avoir d’expiration, utiliser <kbd>infinite</kbd> (infini), <kbd>indefinite</kbd> (non défini), <kbd>infinity</kbd> (infinité) ou <kbd>never</kbd> (jamais).\";'),
('fr','messages:api-help-datatype-timestamp','s:458:\"Les horodatages peuvent être spécifiés sous plusieurs formes, voir [[mw:Special:MyLanguage/Timestamp|les formats d’entrée de la bibliothèque Timestamp documentés sur mediawiki.org]] pour plus de détails. La date et l’heure ISO 8601 sont recommandés : <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. De plus, la chaîne <kbd>now</kbd> peut être utilisée pour spécifier l’horodatage courant.\";'),
('fr','messages:api-help-datatypes-header','s:16:\"Type de données\";'),
('fr','messages:api-help-datatypes-top','s:833:\"Toute entrée de texte dans MediaWiki devrait être encodée en UTF-8 sous forme normalisée canonique précomposée (NFC). MediaWiki peut tenter de convertir d’autres entrées, mais cela peut faire échouer certaines opérations (comme des [[Special:ApiHelp/edit|modifications de pages]] avec les vérifications MD5).\n\nLes paramètres qui prennent plusieurs valeurs sont normalement soumis avec les valeurs séparées par des barres verticales, par ex. <kbd>param=valeur1|valeur2</kbd> ou <kbd>param=valeur1%7Cvaleur2</kbd>. Si une valeur doit contenir une barre verticale, utiliser le contrôle U+001F (séparateur d’unité) comme séparateur \'\'et\'\' préfixer la valeur par U+001F, par ex. <kbd>param=%1Fvaleur1%1Fvaleur2</kbd>.\n\nCertains types de paramètre dans les requêtes de l’API nécessitent plus d’explications :\";'),
