('fr','messages:api-help-right-apihighlimits','s:207:\"Utiliser des valeurs plus hautes dans les requêtes de l’API (requêtes lentes : $1 ; requêtes rapides : $2). Les limites pour les requêtes lentes s’appliquent aussi aux paramètres multivalués.\";'),
('fr','messages:api-help-source','s:13:\"Source : $1\";'),
('fr','messages:api-help-source-unknown','s:56:\"Source : <span class=\"apihelp-unknown\">inconnue</span>\";'),
('fr','messages:api-help-templatedparams','s:695:\"Les paramètres dynamiques (nommés selon un format modèle) prennent en charge les cas où un module d’API a besoin d’une valeur pour chaque valeur d’un autre paramètre quelconque. Par exemple, s’il y avait un module d’API pour demander un fruit, il pourrait avoir un paramètre statique <var>fruits</var> pour spécifier quels fruits sont demandés et un paramètre dynamique <var>{fruit}-quantité</var> pour spécifier la quantité demandée de chacun des fruits. Un client de l’API qui voudrait une pomme, cinq bananes et vingt fraises pourrait alors faire une requête comme <kbd>fruits=pommes|bananes|fraises&pommes-quantité=1&bananes-quantité=5&fraises-quantité=20</kbd>.\";'),
