('fr','messages:api-pageset-param-redirects-generator','s:170:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>, et dans les pages renvoyées par <var>$1generator</var>.\";'),
('fr','messages:api-pageset-param-redirects-nogenerator','s:113:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>.\";'),
('fr','messages:api-pageset-param-revids','s:333:\"Une liste d’identifiants de révision sur lesquels travailler. Noter bien que presque tous les modules de requête convertiront les identifiants de révision en identifiant de la page correspondante et travailleront plutôt sur la dernière révision. Seul <kbd>prop=revisions</kbd> utilise les révisions exactes pour sa réponse.\";'),
