('fr','messages:apihelp-main-param-maxage','s:140:\"Fixer l’entête HTTP de contrôle de cache <code>max-age</code> au nombre indiqué de secondes. Les erreurs ne sont jamais mises en cache.\";'),
('fr','messages:apihelp-main-param-maxlag','s:625:\"La latence maximale peut être utilisée quand MediaWiki est installé sur une grappe de réplication de bases de données. Pour éviter des actions provoquant un supplément de latence de réplication de site, ce paramètre peut faire attendre le client jusqu’à ce que la latence de réplication soit inférieure à une valeur spécifiée. En cas de latence excessive, le code d’erreur <samp>maxlag</samp> est renvoyé avec un message tel que <samp>Attente de $host : $lag secondes de délai</samp>.<br />Voyez [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manuel : paramètre Maxlag]] pour plus d’informations.\";'),
('fr','messages:apihelp-main-param-origin','s:1226:\"En accédant à l’API au moyen d’une requête AJAX inter-domaines (CORS), indiquez le protocole et le nom de domaine d’origine dans ce paramètre. Celui-ci doit être inclus dans toute requête de \'\'pré-envol\'\' et doit donc faire partie de l’URI de la requête (pas du corps de la requête POST).\n\nPour les requêtes authentifiées, cela doit correspondre exactement à une des origines dans l’entête <code>Origin</code>, il doit donc être fixé avec quelque chose comme <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Si ce paramètre ne correspond pas à l’entête <code>Origin</code>, une réponse 403 sera renvoyée. Si ce paramètre correspond à l’entête <code>Origin</code> et l’origine indiquée est autorisée, l’API renseignera les entêtes <code>Access-Control-Allow-Origin</code> et <code>Access-Control-Allow-Credentials</code> dans sa réponse.\n\nPour les requêtes non authentifiées, indiquez la valeur <kbd>*</kbd>. L’API renseignera l’entête <code>Access-Control-Allow-Origin</code> dans sa réponse, mais <code>Access-Control-Allow-Credentials</code> vaudra <code>false</code> et toutes les données spécifiques à l’utilisateur seront restreintes.\";'),
('fr','messages:apihelp-main-param-requestid','s:105:\"Toute valeur fournie ici sera incluse dans la réponse. Peut être utilisé pour distinguer des demandes.\";'),
('fr','messages:apihelp-main-param-responselanginfo','s:97:\"Inclure les langues utilisées pour <var>uselang</var> et <var>errorlang</var> dans le résultat.\";'),
('fr','messages:apihelp-main-param-servedby','s:72:\"Inclure le nom d’hôte qui a renvoyé la requête dans les résultats.\";'),
('fr','messages:apihelp-main-param-smaxage','s:135:\"Fixer l’entête HTTP de contrôle de cache <code>s-maxage</code> à ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),
('fr','messages:apihelp-main-param-uselang','s:404:\"Langue à utiliser pour les traductions de message : utilisez la requête de l’API <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> pour renvoyer une liste de codes de langue, sinon indiquez <kbd>user</kbd> pour utiliser la langue préférée de l’utilisateur actuel, ou bien <kbd>content</kbd> pour utiliser la langue du contenu de ce wiki.\";'),
('fr','messages:apihelp-main-param-variant','s:104:\"Variante de la langue. Ne fonctionne que si la langue de base prend en charge la conversion en variante.\";'),
('fr','messages:apihelp-main-paramvalue-errorformat-bc','s:102:\"Format utilisé avant MediaWiki 1.29. <var>errorlang</var> et <var>errorsuselocal</var> sont ignorés.\";'),
('fr','messages:apihelp-main-paramvalue-errorformat-html','s:4:\"HTML\";'),
('fr','messages:apihelp-main-paramvalue-errorformat-none','s:50:\"Sortie sans texte, seulement les codes d’erreur.\";'),
('fr','messages:apihelp-main-paramvalue-errorformat-plaintext','s:70:\"Wikicode avec les balises HTML supprimés et les entités remplacées.\";'),
