('fr','messages:apihelp-managetags-param-reason','s:77:\"Un motif facultatif pour créer, supprimer, activer ou désactiver la balise.\";'),
('fr','messages:apihelp-managetags-param-tag','s:347:\"Balise à créer, supprimer, activer ou désactiver. Pour la création de balise, elle ne doit pas exister. Pour la suppression de balise, elle doit exister. Pour l’activation de balise, elle doit exister et ne pas être utilisée par une extension. Pour la désactivation de balise, elle doit être actuellement active et définie manuellement.\";'),
('fr','messages:apihelp-managetags-param-tags','s:83:\"Modifier les balises à appliquer à l’entrée du journal de gestion des balises.\";'),
