('fr','messages:apihelp-managetags-paramvalue-operation-create','s:64:\"créer une nouvelle balise de modification pour un usage manuel.\";'),
('fr','messages:apihelp-managetags-paramvalue-operation-deactivate','s:98:\"désactiver une balise de modification, empêchant les utilisateurs de l’appliquer manuellement.\";'),
('fr','messages:apihelp-managetags-paramvalue-operation-delete','s:229:\"supprimer une balise de modification de la base de données, ce qui inclut supprimer la balise de toutes les versions, des entrées de modifications récentes, ainsi que des entrées de journal dans lesquelles elle est utilisée.\";'),
