('fr','messages:apihelp-mergehistory-example-merge-timestamp','s:130:\"Fusionner les versions de la page <kbd>AnciennePage</kbd> jusqu’au <kbd>2015-12-31T04:37:41Z</kbd> dans <kbd>NouvellePage</kbd>.\";'),
