('fr','messages:apihelp-options-extended-description','s:241:\"Seules les options inscrites dans le noyau ou dans l’une des extensions installées, ou les options avec des clés préfixées par <code>userjs-</code> (conçues pour être utilisées dans les scripts utilisateur), peuvent être définies.\";'),
('fr','messages:apihelp-options-param-change','s:458:\"Liste des modifications, au format « nom=valeur » (par ex. « skin=vector »). Si aucune valeur n’est fournie (pas même un signe égal), par ex., « nomoption|autreoption|… », l’option sera réinitialisée à sa valeur par défaut. Pour toute valeur passée contenant une barre verticale (<kbd>|</kbd>), utiliser le [[Special:ApiHelp/main#main/datatypes|séparateur alternatif de valeur multiple]] pour que l’opération soit correcte.\";'),
