('fr','messages:apihelp-parse-example-texttitle','s:57:\"Analyser du wikicode, en spécifiant le titre de la page.\";'),
('fr','messages:apihelp-parse-extended-description','s:583:\"Voyez les différents « prop-modules » de <kbd>[[Special:ApiHelp/query|action=query]]</kbd> pour obtenir des informations sur la version actuelle d’une page.\n\nIl y a plusieurs moyens de spécifier le texte à analyser :\n# spécifier une page ou une version, en utilisant <var>$1page</var>, <var>$1pageid</var> ou <var>$1oldid</var> ;\n# spécifier explicitement un contenu, en utilisant <var>$1text</var>, <var>$1title</var>, <var>$1revid</var> et <var>$1contentmodel</var> ;\n# spécifier uniquement un résumé à analyser. <var>$1prop</var> doit avoir une valeur vide.\";'),
('fr','messages:apihelp-parse-param-contentformat','s:114:\"Format de sérialisation du contenu utilisé pour le texte d’entrée. Valide uniquement si utilisé avec $1text.\";'),
('fr','messages:apihelp-parse-param-contentmodel','s:187:\"Modèle de contenu du texte d’entrée. Si omis, $1title doit être spécifié et la valeur par défaut sera le modèle du titre spécifié. Valide uniquement quand utilisé avec $1text.\";'),
('fr','messages:apihelp-parse-param-disableeditsection','s:75:\"Omettre les liens de modification de section de la sortie de l’analyseur.\";'),
