('fr','messages:apihelp-parse-param-effectivelanglinks','s:101:\"Inclut les liens de langue fournis par les extensions (à utiliser avec <kbd>$1prop=langlinks</kbd>).\";'),
('fr','messages:apihelp-parse-param-generatexml','s:132:\"Générer un arbre d’analyse XML (nécessite le modèle de contenu <code>$1</code> ; remplacé par <kbd>$2prop=parsetree</kbd>).\";'),
('fr','messages:apihelp-parse-param-oldid','s:87:\"Analyser le contenu de cette version. Écrase <var>$1page</var> et <var>$1pageid</var>.\";'),
('fr','messages:apihelp-parse-param-onlypst','s:228:\"Effectuer une transformation de préenregistrement (PST) de l’entrée, mais ne pas l’analyser. Renvoie le même wikicode, après que la PST a été appliquée. Valide uniquement quand c’est utilisé avec <var>$1text</var>.\";'),
