('fr','messages:apihelp-parse-param-pageid','s:61:\"Analyser le contenu de cette page. Écrase <var>$1page</var>.\";'),
('fr','messages:apihelp-parse-param-preview','s:25:\"Analyser en mode aperçu.\";'),
('fr','messages:apihelp-parse-param-prop','s:32:\"Quelles informations obtenir :\";'),
