('fr','messages:apihelp-parse-param-redirects','s:108:\"Si le paramètre <var>$1page</var> ou <var>$1pageid</var> est positionné sur une redirection, la résoudre.\";'),
('fr','messages:apihelp-parse-param-revid','s:102:\"Identifiant de version, pour <code><nowiki>{{REVISIONID}}</nowiki></code> et les variables similaires.\";'),
