('fr','messages:apihelp-parse-param-sectionpreview','s:72:\"Analyser en mode aperçu de section (active également le mode aperçu).\";'),
('fr','messages:apihelp-parse-param-sectiontitle','s:230:\"Nouveau titre de section quand <var>section</var> vaut <kbd>new</kbd> (nouveau).\n\nÀ la différence d’une modification de page, cela ne se replie pas à la valeur de <var>summary</var> (résumé) quand le titre est omis ou vide.\";'),
('fr','messages:apihelp-parse-param-showstrategykeys','s:102:\"Indique s’il faut inclure les informations sur la stratégie interne de fusion dans jsconfigvars .\";'),
('fr','messages:apihelp-parse-param-summary','s:21:\"Résumé à analyser.\";'),
