('fr','messages:apihelp-query+revisions+base-param-difftotextpst','s:223:\"Utiliser <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> à la place. Effectuer une transformation avant enregistrement sur le texte avant de le comparer. Valide uniquement quand utilisé avec <var>$1difftotext</var>.\";'),
('fr','messages:apihelp-query+revisions+base-param-expandtemplates','s:177:\"Utiliser <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> à la place. Développer les modèles dans le contenu de la révision (nécessite $1prop=content).\";'),
