('fr','messages:apihelp-query+revisions+base-param-slots','s:267:\"Pour quels emplacements de version renvoyer des données, quand les propriétés relatives aux emplacements sont incluses dans <var>$1props</var>. Si omis, les données de l’emplacement <kbd>main</kbd> (principal) seront renvoyées dans un format rétro-compatible.\";'),
