('fr','messages:blockedtext','s:668:\"<strong>Votre compte d’utilisateur ou votre adresse IP a été bloqué.</strong>\n\n{{int:blockedtext-made-by|$1}}\n{{int:blockedtext-reason-comment|$2}}.\n\n* {{int:blockedtext-start-time|$8}}\n* {{int:blockedtext-expiration-time|$6}}\n* {{int:blockedtext-intended-blockee|$7}}\n\n{{int:blockedtext-contact-blocker-admin|$1}}\nVous pouvez utiliser la fonction « {{int:emailuser}} » que si une adresse de courriel valide est spécifiée dans vos [[Special:Preferences|préférences]] et que si cette fonctionnalité ne vous a pas été bloquée.\n{{int:blockedtext-block-ip|$3}} et votre identifiant de blocage est le nº $5.\n{{int:blockedtext-include-details-queries}}\";'),
