('fr','messages:blockiptext','s:607:\"Utilisez le formulaire ci-dessous pour bloquer les tentatives de modification faites à partir d’une adresse IP spécifique ou d’un nom d’utilisateur.\nUne telle mesure ne devrait être prise que pour prévenir le vandalisme et en accord avec les [[{{MediaWiki:Policy-url}}|règles internes]].\nDonnez ci-dessous un motif précis (par exemple en citant les pages qui ont été vandalisées).\nVous pouvez bloquer des plages d’adresses IP en utilisant la syntaxe [https://fr.wikipedia.org/wiki/Adresse_IP#Agrégation_des_adresses CIDR] ; la plus grande plage autorisée est /$1 en IPv4 et /$2 en IPv6.\";'),
