('fr','messages:clearyourcache','s:777:\"<strong>Note :</strong> après avoir publié vos modifications, il se peut que vous deviez forcer le rechargement complet du cache de votre navigateur pour voir les changements.\n* <strong>Firefox / Safari :</strong> maintenez la touche <em>Maj</em> (<em>Shift</em>) en cliquant sur le bouton <em>Actualiser</em> ou appuyez sur <em>Ctrl + F5</em> ou <em>Ctrl + R</em> (<em>⌘ + R</em> sur un Mac).\n* <strong>Google Chrome :</strong> appuyez sur <em>Ctrl + Maj + R</em> (<em>⌘ + Shift + R</em> sur un Mac).\n* <strong>Internet Explorer / Edge :</strong> maintenez la touche <em>Ctrl</em> en cliquant sur le bouton <em>Actualiser</em> ou pressez <em>Ctrl + F5</em>.\n* <strong>Opera :</strong> appuyez sur <em>Ctrl + F5</em>.\";'),
