('fr','messages:confirmemail_body','s:499:\"Quelqu’un, probablement vous, à partir de l’adresse IP $1,\na créé un compte « $2 » avec cette adresse de courriel sur le site {{SITENAME}}.\n\nPour confirmer que ce compte vous appartient vraiment et afin d’activer les fonctions\nde messagerie sur {{SITENAME}}, veuillez suivre ce lien dans votre navigateur :\n\n$3\n\nSi vous n’avez *pas* créé ce compte, suivez le lien ci-dessous\npour annuler la confirmation de votre adresse courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),
('fr','messages:confirmemail_body_changed','s:563:\"Quelqu’un, probablement vous, à partir de l’adresse IP $1, a modifié\nl’adresse de courriel associée au compte « $2 » sur {{SITENAME}} en cette adresse.\n\nPour confirmer que ce compte vous appartient vraiment et réactiver les\nfonctions de messagerie sur {{SITENAME}}, veuillez suivre ce lien dans votre navigateur :\n\n$3\n\nSi ce compte ne vous appartient *pas*, n’ouvrez pas le lien précédent ; suivez plutôt\nle lien ci-dessous pour annuler la demande de confirmation de votre adresse courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),
('fr','messages:confirmemail_body_set','s:473:\"Quelqu’un, probablement vous, depuis l’adresse IP $1,\na modifié l’adresse de courriel du compte « $2 » en celle-ci sur {{SITENAME}}.\n\nPour confirmer que ce compte vous appartient et réactiver les\nfonctions de courriel sur {{SITENAME}}, ouvrez ce lien dans votre navigateur :\n\n$3\n\nSi le compte ne vous appartient *pas*, suivez plutôt ce lien\npour annuler la demande de confirmation de l’adresse de courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),
