('fr','messages:copyrightwarning2','s:561:\"Notez bien que toutes les contributions à {{SITENAME}} peuvent être modifiées, transformées ou supprimées par d’autres utilisateurs.\nSi vous ne désirez pas que vos écrits soient modifiés contre votre gré, merci de ne pas les soumettre ici.<br />\nVous nous promettez aussi que vous avez écrit ceci vous-même ou que vous l’avez copié d’une source placée dans le domaine public ou d’une ressource libre similaire (voir $1 pour plus de détails).\n<strong>N’utilisez aucun travail sous droits d’auteur sans autorisation expresse !</strong>\";'),
