('fr','messages:default-skin-not-found','s:2105:\"Oups   L’habillage par défaut pour votre wiki, défini par <code dir=\"ltr\">$wgDefaultSkin</code> comme <code>$1</code>, n’est pas disponible.\n\nVotre installation semble inclure {{PLURAL:$4|l’habillage suivant|les habillages suivants}}. Voyez le [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration manuel de configuration des habillages] pour savoir comment {{PLURAL:$4|l’activer|les activer}} et choisir celui par défaut.\n\n$2\n\n; Si vous venez juste d’installer MediaWiki :\n: Vous l’avez probablement installé depuis git ou directement depuis le code source avec une autre méthode. C’est normal. Essayez d’installer des habillages depuis le [https://www.mediawiki.org/wiki/Category:All_skins répertoire des habillages de mediawiki.org] :\n:* En téléchargeant le [https://www.mediawiki.org/wiki/Special:MyLanguage/Download fichier tar du programme d’installation], qui comprend plusieurs habillages et extensions. Vous pouvez copier et coller le répertoire <code>skins/</code> depuis là.\n:* En téléchargeant les fichiers tar d’habillage individuel depuis [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* En téléchargeant des [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins habillages avec Git].\n: Faire ainsi ne devrait pas interférer avec votre dépôt git, si vous êtes un développeur de MediaWiki.\n\n; Si vous venez juste de mettre à jour MediaWiki :\n: MediaWiki 1.24 et au-delà n’active plus automatiquement les habillages installés (voyez le [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery manuel sur la découverte automatique des habillages]). Vous pouvez coller {{PLURAL:$5|la ligne suivante|les lignes suivantes}} dans <code>LocalSettings.php</code> pour activer {{PLURAL:$5|l’habillage actuellement installé|tous les habillages actuellement installés}} :\n\n<pre dir=\"ltr\">$3</pre>\n\n; Si vous venez de modifier <code>LocalSettings.php</code> :\n: Vérifiez deux fois le nom des habillages pour éviter les erreurs de frappe.\";'),
('fr','messages:default-skin-not-found-no-skins','s:1494:\"Oups ! L’habillage par défaut pour votre wiki , défini par <code>$wgDefaultSkin</code> comme <code>$1</code>, n’est pas disponible.\n\nVous n’avez aucun habillage d’installé.\n\n; Si vous venez juste d’installer ou de mettre à jour MediaWiki :\n: Vous l’avez sans doute fait depuis git, ou directement depuis le code source avec une autre méthode. C’est normal. MediaWiki 1.24 et au-delà n’inclut aucun habillage dans le dépôt principal. Essayez d’installer des habillages depuis [https://www.mediawiki.org/wiki/Category:All_skins le répertoire des habillages de mediawiki.org] :\n:* En téléchargeant [https://www.mediawiki.org/wiki/Special:MyLanguage/Download le fichier tar du programme d’installation], qui comprend différents habillages et extensions. Vous pouvez copier et coller le répertoire <code>skins/</code> depuis là.\n:* En téléchargeant les fichiers tar d’habillage individuel depuis [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* En téléchargeant des  [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins habillages avec Git].\n: Faire ainsi ne devrait pas interférer avec votre dépôt git si vous êtes un développeur de MediaWiki. Voyez le [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration manuel de la configuration des habillages] pour des instructions sur la manière d’activer les habillages et choisir celui par défaut.\";'),
