('fr','messages:metadata-fields','s:1593:\"Les champs de métadonnées d’image listés ci-dessous seront inclus dans la page de description de l’image quand la table de métadonnées sera réduite (les autres champs seront cachés par défaut) :\n* make (fabricant de l’appareil)\n* model (modèle de l’appareil)\n* datetimeoriginal (horodatage original)\n* exposuretime (durée d’exposition)\n* fnumber (ouverture de l’objectif)\n* isospeedratings (sensibilité ISO)\n* focallength (distance focale)\n* artist (artiste)\n* copyright (droits d’auteur)\n* imagedescription (description de l’image)\n* gpslatitude (latitude GPS)\n* gpslongitude (longitude GPS)\n* gpsaltitude (altitude GPS)\n* dc-rights (droits DC)\n* copyrightowner (titulaire des droits d’auteur)\n* usageterms (conditions d’utilisation)\n* webstatement (déclaration sur le web)\n* licenseurl (URL de la licence)\n* attributionurl (URL d’attribution)\n* preferredattributionname (nom d’attribution préféré)\n* credit (crédit)\n* jpegfilecomment (commentaire de fichier JPEG)\n* pngfilecomment (commentaire de fichier PNG)\n* giffilecomment (commentaire de fichier GIF)\n* usercomment (commentaire de l’utilisateur)\n* citydest (ville de destination)\n* citycreated (ville de création)\n* headline (ligne d’entête)\n* source (source)\n* locationdest (lieu de destination)\n* dc-contributor (contributeur DC)\n* dc-coverage (couverture DC)\n* dc-publisher (éditeur DC)\n* dc-relation (relation DC)\n* label (libellé)\n* nickname (surnom)\n* personinimage (personne en image)\n* disclaimer (déni de responsabilité)\n* event (événement)\n* objectname (nom de l’objet)\";'),
