('fr','messages:movepagebtn','s:16:\"Renommer la page\";'),
('fr','messages:movepagetalktext','s:278:\"Si vous cochez cette case, la page de discussion associée sera automatiquement renommée, à moins qu’une page de discussion non vide existe déjà sous ce nouveau nom.\n\nDans ce cas, vous devrez renommer ou fusionner cette page de discussion manuellement si vous le désirez.\";'),
('fr','messages:movepagetext','s:1167:\"Utilisez le formulaire ci-dessous pour renommer une page, tout en déplaçant tout son historique vers le nouveau nom. L’ancien titre deviendra une page de redirection vers le nouveau titre.\nVous pouvez mettre à jour automatiquement les redirections qui pointent vers le titre original.\nSi vous choisissez de ne pas le faire, assurez-vous de vérifier toute [[Special:DoubleRedirects|double redirection]] ou [[Special:BrokenRedirects|redirection cassée]]. Vous avez la responsabilité de vous assurer que les liens continuent de pointer vers leur destination supposée.\n\nNotez que la page ne sera <strong>pas</strong> renommée s’il existe déjà une page portant le nouveau titre, sauf si cette dernière est une simple redirection avec un historique de modifications vierge.\nCela signifie que vous pouvez de nouveau renommer une page vers sa position d’origine si vous avez fait une erreur mais que vous ne pouvez pas écraser une page existante.\n\n<strong>Attention !</strong>\nCeci peut provoquer un changement radical et imprévu pour une page souvent consultée ; assurez-vous d’avoir compris les conséquences de votre démarche avant de continuer.\";'),
('fr','messages:movepagetext-noredirectfixer','s:1022:\"Utilisez le formulaire ci-dessous pour renommer une page, tout en déplaçant tout son historique vers le nouveau nom.\nL’ancien titre deviendra une page de redirection vers le nouveau titre.\nVérifiez bien les [[Special:DoubleRedirects|doubles redirections]] ou les [[Special:BrokenRedirects|redirections cassées]].\nVous avez la responsabilité de vous assurer que les liens continuent de pointer vers leur destination supposée.\n\nNotez que la page ne sera <strong>pas</strong> déplacée s’il existe déjà une page avec le nouveau titre, sauf si cette dernière a un historique de modifications vierge et est soit vide, soit une simple redirection.\nCela signifie que vous pouvez renommer une page vers sa position d’origine si le déplacement s’avère erroné mais que vous ne pouvez pas écraser une page existante.\n\n<strong>Attention !</strong>\nCeci peut provoquer un changement radical et imprévu pour une page souvent consultée ; assurez-vous d’en avoir compris les conséquences avant de continuer.\";'),
('fr','messages:movepagetext-noredirectsupport','s:712:\"Utilisez le formulaire ci-dessous pour renommer une page, tout en déplaçant tout son historique vers le nouveau nom.\nVous avez la responsabilité de vous assurer que les liens continuent de pointer vers leur destination supposée.\n\nNotez que la page ne sera <strong>pas</strong> déplacée s’il existe déjà une page avec le nouveau titre.\nCela signifie que vous pouvez renommer une page vers sa position d’origine si le déplacement s’avère erroné mais que vous ne pouvez pas écraser une page existante.\n\n<strong>Attention !</strong>\nCeci peut être un changement radical et imprévu pour une page fréquemment consultée ;\nassurez-vous d’en avoir compris les conséquences avant de continuer.\";'),
