('fr','messages:passwordreset-emailelement','s:56:\"Nom d’utilisateur : \n$1\n\nMot de passe temporaire : \n$2\";'),
('fr','messages:passwordreset-emailtext-ip','s:740:\"Quelqu’un (probablement vous, depuis l’adresse IP $1) a demandé une réinitialisation de votre mot de passe pour {{SITENAME}} ($4). {{PLURAL:$3|Le compte de l’{{GENDER:$2|utilisateur suivant|utilisatrice suivante}} est associé|Les comptes des utilisateurs suivants sont associés}} à cette adresse de courriel :\n\n$2\n\n{{PLURAL:$3|Ce mot de passe temporaire expirera|Ces mots de passe temporaires expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. \nVous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou si vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),
('fr','messages:passwordreset-emailtext-require-email','s:395:\"Toutefois, si vous n’avez pas généré cette demande et que vous souhaitez\nempêcher les courriels non sollicités, vous voudrez peut-être mettre à jour\nvos options de messagerie à\n$1.\nVous pouvez exiger à la fois un nom d’utilisateur et une adresse électronique\npour générer des courriels de réinitialisation de mot de passe. Cela peut\nréduire le nombre de ce genre d’incidents.\";'),
('fr','messages:passwordreset-emailtext-user','s:745:\"L’{{GENDER:$1|utilisateur|utilisatrice}} $1 sur {{SITENAME}} a demandé une réinitialisation de votre mot de passe pour {{SITENAME}} ($4). {{PLURAL:$3|Le compte de l’{{GENDER:$2|utilisateur suivant|utilisatrice suivante}} est associé|Les comptes des utilisateurs suivants sont associés}} à cette adresse de courriel :\n\n$2\n\n{{PLURAL:$3|Ce mot de passe temporaire expirera|Ces mots de passe temporaires expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. \nVous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou si vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),
