('fr','messages:passwordreset-success','s:57:\"Vous avez demandé une réinitialisation du mot de passe.\";'),
('fr','messages:passwordreset-success-details-generic','s:600:\"Si l’information soumise est correcte, une réinitialisation de mot de passe a été envoyée. Si vous n’avez pas reçu de courriel, nous vous recommandons d’aller sur la [[mw:Special:MyLanguage/Help:Reset_password|page d’aide à la réinitialisation de mot de passe]] ou de réessayer ultérieurement. Vous pouvez seulement <strong>demander un nombre limité de réinitialisations de mot de passe pendant une courte période de temps. Seul un courriel de réinitialisation de mot de passe sera envoyé par compte valide toutes les {{PLURAL:$1||$1}} heures</strong>, pour prévenir tout abus.\";'),
