('fr','messages:uploadtext','s:1300:\"Utilisez le formulaire ci-dessous pour téléverser des fichiers sur le serveur.\nPour voir ou rechercher des images précédemment téléversées, consultez la [[Special:FileList|liste des fichiers téléversés]]. Les téléversements successifs sont également tracés dans le [[Special:Log/upload|journal des téléversements]] et les suppressions dans le [[Special:Log/delete|journal des suppressions]].\n\nPour inclure un fichier dans une page, utilisez un lien ayant l’un des formats suivants :\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:fichier.jpg]]</nowiki></code></strong>, pour afficher le fichier complet (en pleine résolution si c’est une image) ;\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:fichier.png|200px|thumb|left|Texte descriptif]]</nowiki></code></strong> pour afficher une vignette de 200 pixels de large dans une boîte à gauche avec le « Texte descriptif » affiché dessous ;\n* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:fichier.ogg]]</nowiki></code></strong> ou <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:fichier.ogg|libellé]]</nowiki></code></strong> pour afficher un lien direct vers le fichier sans l’afficher (avec un éventuel « libellé » au lieu d’afficher le nom complet du fichier lui-même).\";'),
